import { Link } from 'react-router-dom'
import styles from './styles.module.scss'

export default function Header() {
    return (
            <header className={styles.headerContainer}>
                <nav>
                    <Link to="/">Home</Link>
                    <Link to="Login">Criar Login</Link>
                </nav>
            </header>
    )
}
